        document.write('bien ahi')
    }
    else{
        document.write('no te creo')
    }
    return(
        <div>
            {}
            <h1>Tenes tarea owo</h1>
            <span style={text ? {background:"green"} : {background:'red'}}>
                {text ? 'Tarea Hecha' : 'Tarea Sin hacer'}
            </span>
        </div>

    )
}
